import React from "react";
import Cell from "./Cell";
import { nanoid } from "nanoid";

export default function ChainOfCells({ word }) {
  const charElements = word.map((char) => <Cell key={nanoid()} />);
  return (
    <div className="chain-of-cells">
      <Cell />
      <Cell />
      <Cell />
      <Cell />
      <Cell />
    </div>
  );
}
